import React from 'react';


const SearchResult=(props)=>{
    const ig=`https://source.unsplash.com/600x500/?${props.name}`;
    return(
        <div>
            <img src={ig} alt="Jishan's Gallary"/>
        </div>
    )
};
export default SearchResult;
